import { Modal, Select, Input } from 'antd';

function AddNew(props) {
  const { Option } = Select;

  
  return (
    <>
      <Modal
        title="Locations"
        visible={props.visible}
        onOk={props.onOk}
        onCancel={props.onCancel}
      ></Modal>
    </>
  );
}

export default AddNew;
